import * as React from "react";

import styled from "styled-components";

import SectionTitle from "./SectionTitle";
import VerticalSpacer from "./VerticalSpacer";

const List = styled.ul`
  display: flex;
  flex-direction: column;

  width: min(500px, 85%);

  margin-bottom: 2rem;

  li {
    list-style: decimal;
    list-style-position: inside;

    font-family: "Montserrat Light";

    font-size: 1.2rem;
    line-height: 1.4;

    margin-bottom: 1.5rem;
  }
`;

const QRContainer = styled.div`
  width: min(800px, 85%);

  display: flex;
  flex-direction: row;
  justify-content: space-between;

  @media screen and (max-width: 940px) {
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }
`;

const QRLink = styled.a`
  border-radius: 38.5px;

  width: min(100%, 24rem);
  aspect-ratio: 1/1;

  padding: 1rem;
  margin-bottom: 2rem;

  position: relative;

  a {
    color: var(--text-color);
  }

  :focus-visible {
    outline: none;
  }

  :focus-visible::before {
    content: "";
    position: absolute;
    top: -2px;
    right: -2px;
    bottom: -2px;
    left: -2px;
    border: 2px solid var(--focus-color);
    border-radius: 38.5px;
  }

  :link {
    color: var(--text-color);
  }

  :visited {
    color: var(--text-color);
  }

  :hover {
    color: var(--text-color);
  }

  :active {
    color: var(--text-color);
  }
`;

const RoundedSquare = styled.div`
  background-color: var(--baltimore-purple);

  width: 100%;
  min-height: 24rem;

  display: flex;
  flex-direction: column;
  align-items: center;

  padding: 1rem;

  border-radius: 22.5px;

  transition: background-color 200ms;

  :hover {
    background-color: var(--baltimore-purple-darker);
  }
`;

const ServiceIcon = styled.div`
  width: 100%;
  height: 3rem;

  display: flex;
  justify-content: center;

  margin-bottom: 1rem;

  p {
    font-size: 1.8rem;
    color: var(--off-white);
  }

  svg {
    path {
      fill: var(--off-white);
    }
  }

  * {
    width: 100%;
  }
`;

const QRCode = styled.div`
  background-color: var(--off-white);

  width: min(12rem, 100%);
  aspect-ratio: 1/1;

  margin-bottom: 1.5rem;

  svg {
    rect {
      fill: var(--off-white);
    }
  }

  * {
    display: block;
  }
`;

const Name = styled.div`
  height: 2rem;

  margin-bottom: 0.5rem;

  p {
    font-size: 1.2rem;
    color: var(--off-white);
  }
`;

const Subtitle = styled.div`
  height: 1rem;

  margin-bottom: 0.5rem;

  p {
    font-size: 1rem;
    font-family: "Montserrat Light";
    color: var(--off-white);
  }
`;

